const dataforseoResponse = $input.item.json;

// Extract webhook metadata from previous nodes (if available)
// This should come from the original webhook or a Set node
const webhookData = $('Webhook2').first().json.body || {
  request_id: dataforseoResponse.request_id || 'unknown',
  callback_url: null,
  type: 'bulk_summary'
};

// Check if DataForSEO request was successful
if (dataforseoResponse.status_code !== 20000) {
  return {
    json: {
      request_id: webhookData.request_id,
      success: false,
      data: null,
      error: `DataForSEO error: ${dataforseoResponse.status_message || 'Unknown error'}`
    }
  };
}

// Extract results from DataForSEO response
// DataForSEO structure: tasks[0].result[0].items (array of page summary objects)
let itemsArray = [];

try {
  if (dataforseoResponse.tasks && Array.isArray(dataforseoResponse.tasks) && dataforseoResponse.tasks.length > 0) {
    const task = dataforseoResponse.tasks[0];

    // Check task status
    if (task.status_code !== 20000) {
      return {
        json: {
          request_id: webhookData.request_id,
          success: false,
          data: null,
          error: `DataForSEO task error: ${task.status_message || 'Unknown error'}`
        }
      };
    }

    // Extract items from tasks[0].result[0].items
    if (task.result && Array.isArray(task.result) && task.result.length > 0) {
      const resultObj = task.result[0];
      if (resultObj.items && Array.isArray(resultObj.items)) {
        itemsArray = resultObj.items;
      } else {
        // Fallback: if result[0] itself is an array of items
        itemsArray = task.result;
      }
    } else {
      // No results found
      return {
        json: {
          request_id: webhookData.request_id,
          success: false,
          data: null,
          error: 'No results in DataForSEO response'
        }
      };
    }
  } else {
    return {
      json: {
        request_id: webhookData.request_id,
        success: false,
        data: null,
        error: 'No tasks in DataForSEO response'
      }
    };
  }
} catch (error) {
  return {
    json: {
      request_id: webhookData.request_id,
      success: false,
      data: null,
      error: `Error parsing DataForSEO response: ${error.message || String(error)}`
    }
  };
}

// Success - return items array in format expected by backend webhook
// Backend expects: {success: true, data: {items: [...]}} or {success: true, data: [...]}
return {
  json: {
    request_id: webhookData.request_id,
    success: true,
    data: {
      items: itemsArray  // Array of {url: str, rank: int, backlinks: int, ...}
    },
    error: null
  }
};

const MAX_DOMAINS = 100; // DataForSEO limit: 100 unique domains per request (API allows 1000 total targets but only 100 unique)
const PLACEHOLDER_DOMAIN = "i-am-a-placeholder-for-n8n.com"; 

// 1. Extract the domains array from the first input item
