const domains = inputItem.body.domains || []; 

// 2. Ensure unique domains and limit to MAX_DOMAINS
const uniqueDomains = [...new Set(domains)].slice(0, MAX_DOMAINS);

// 3. Pad the array up to MAX_DOMAINS length with placeholder domain if needed
const paddedDomains = [...uniqueDomains];
while (paddedDomains.length < MAX_DOMAINS) {
  paddedDomains.push(PLACEHOLDER_DOMAIN);
}
paddedDomains.length = MAX_DOMAINS; 

// 4. Construct the single output item with numbered properties (domain_1, domain_2, etc.)
let outputJson = {};

paddedDomains.forEach((domain, index) => {
  const key = `domain_${index + 1}`; 
  outputJson[key] = domain;
});

// 5. Return the result as a single item
return [
  {
    json: outputJson
  }
];

